import { Button, TextField } from "@mui/material";
import React, { useState } from "react";
import { Autocomplete } from "@mui/material";
import Box from "@mui/material/Box";

const Test = () => {
  const filmler = [
    { label: "The Shawshank Redemption", year: 1994 },
    { label: "The Godfather", year: 1972 },
    { label: "azat", year: 1972 },
    { label: "The Godfather: Part II", year: 1974 },
  ];
  const [errorMessage, setErrorMessage] = useState(false);

  const [value, setValue] = useState("");

  const hello = () => {
    console.log(value);
  };

  const handleChange = (e) => {
    const newValue = e.target.value;
    setValue(newValue);

    if (newValue !== "") {
      setErrorMessage(false);
    } else {
      setErrorMessage(true);
    }
  };

  return (
    <>
      <div>
        <Button onClick={hello} variant="contained">
          Hello world
        </Button>
      </div>

      <div>
        <Autocomplete
          disablePortal
          options={filmler}
          sx={{ width: 300 }}
          renderInput={(params) => (
            <TextField {...params} label="Movie" helperText />
          )}
        />
      </div>

      <div>
        <TextField
          label="azat"
          value={value}
          onChange={handleChange}
          error={errorMessage}
        />
      </div>

      <div>
        <Box
          component="form"
          sx={{ "& > :not(style)": { m: 1, width: "25ch" } }}
          noValidate
          autoComplete="off"
        >
          <TextField id="standard-basic" label="pasword" variant="standard" />
        </Box>
      </div>
    </>
  );
};

export default Test;
